import './App.css';
import { ThemeProvider, createTheme } from '@material-ui/core/styles';
import { blue } from '@material-ui/core/colors';
import Banner from './Banner'
import NavBar from './NavBar';
import { Route, Routes } from 'react-router-dom';
import { Container } from '@material-ui/core';

const theme = createTheme({
  palette: {
    primary: {
      main: '#2566a6',
      contrastText: '#ececec',
    },
    secondary: {
      main: '#ececec'
    },
    sheet: {
      main: '#fff',
      contrastText: '#0c1a28',
    },
  },
});

function App() {
  return (
    <ThemeProvider theme={theme}>
      <div className="App">
        <Banner />
        <NavBar />
        <Container
          color = 'primary'
          style={{ width: '800px', border: '2px solid balck' }}
        >
          <p>Hello</p>
        </Container>
        {/* <Routes>
          <Route/>
        </Routes> */}
      </div>
    </ThemeProvider>
  );
}

export default App;
